import React, { Component } from 'react';

const SeriesList = (props) => {
    return (
        <div>
            Series List component:
            <ul className = "seriesList">
                {props.list.map(item =>( 
                    <li>{item}</li>
                ))}
            </ul>
        </div>
    )
}

export default SeriesList;
